import React from "react";
import { Outlet,Link } from "react-router-dom";

export default function NavigatopPage(){
    return(
        <div>
            <h1>Hello username!</h1>
            <nav>
                <Link to='/App'>App</Link> |{' '} 
                <Link to='/About'>About</Link>
            </nav>
            <Outlet/>
        </div>
    )
}
